const exercisesSlice = createSlice({
  name: 'exercises',
  initialState,
  reducers: {
    addExercise: (state, action: PayloadAction<Exercise>) => {
      const exists = state.items.some(ex => ex.id === action.payload.id);
      if (!exists) {
        state.items.push(action.payload);
      }
    },addExerciseToLocalStorage: (_, action: PayloadAction<Exercise>) => {
      const savedExercises = localStorage.getItem('exercisesData');
      let parsedExercises = [] as Exercise[];
      if(savedExercises) {
        parsedExercises = JSON.parse(savedExercises) as Exercise[];
      }
      parsedExercises.push(action.payload);
      localStorage.setItem('exercisesData', JSON.stringify(parsedExercises));
    },
    updateExercise: (state, action: PayloadAction<Exercise>) => {
      const index = state.items.findIndex(ex => ex.id === action.payload.id);
      if (index !== -1) {
        state.items[index] = action.payload;
      }
    },
    deleteExercise: (state, action: PayloadAction<string>) => {
      state.items = state.items.filter(ex => ex.id !== action.payload);
    },
  },
});

export const { addExercise,addExerciseToLocalStorage, updateExercise, deleteExercise } = exercisesSlice.actions;
export default exercisesSlice.reducer;